Rules.InvariantScript:
Set(
    ScannedItem,
    First(BarcodeReader2.Barcodes).Value
);

ClearCollect(
    colSortedItems,
    SortByColumns(
        Filter(
            colLines,
            Barcode = ScannedItem
        ), 
        "Barcode"
    )
);

ClearCollect(
    colFinalList,
    colSortedItems,
    SortByColumns(
        Filter(
            colLines,
            Barcode <> ScannedItem
        ),
        "Barcode"
    )
);

If(
    App.ActiveScreen = scr_Entry,
    Set(
        isModalOpen,
        true
    ),
    Set(
        wizardStep,
        2
    )
);
